description:
Recently sold: $150,900. Beautiful home that was updated 12 months ago. The townhome fetures 3 beds, 1 full bath and 1 3/4 bath. The master bed room is on ground level with a walk out to the back yard. The master bed room also has its own private bath and laundry room attached. Home has all new carpet and luxry vynal plank and tile flooring though out. The entire home has been painted walls, trim, and doors. Updated all appliances to stainless and NEW GRANITE COUNTER TOPS. New concrete drive way last year and a two stall garage that stays vary warm all winter long. The home is move in ready. Neighbors are quite and frindley. (Photots coming soon
)

Owner pays association and garbage. Tenant pays -utilites

Recently sold: $472,000. Must see this fantastic rambler with 3 bedrooms, 3 baths, 10 car garage with the river view.  Walking up to the home with a large 9 x 14 porch overlooking the large front yard, nice foyer with ceramic flooring with a view of the large great room, dining room and kitchen.  6 panel doors throughout the home, a large vaulted great room has maple built-in cabinets/entertainment center with a cherry stain, gas fireplace with ceramic surround and maple cherry stained mantel.  The  vaulted eat in dining room/informal dining room is bayed out on 2 sides, patio door going out to the large 14 x 18 deck overlooking the back yard.  Brazilian cherry floors through the dining room and kitchen.  The vaulted kitchen offers raised maple  white enamel staggered 42 inch cabinets, corian counter tops, with a breakfast bar seating around the center island.  Main floor laundry has ceramic flooring and upper cabinets for storage.  The large master bedroom with 6 panel french doors, walk-in closet and master suite with 3/4 shower/whirlpool tub, double vanity and ceramic flooring.  The 2nd bedroom up offers 6 panel door, bayed out wall and ceiling fan.  The main level full ceramic bathroom can be entered from the hall or the 2nd bedroom.

The lower level is fully finished walkout basement, large family with corner gas fireplace, ceramic surround and  beautiful wood mantel.  The 3rd bedroom has 6 panel french doors and bi-fold double closet and a full bath in the lower level.  There is a work shop off the family room with upper cabinets for storage and that is connected to the entrance to the spancrete basement (3 car) in lower level with hot water and washing tub.  The detached garage is 24 x 42, finished with vaulted ceilings, cabinets and a  car lift with a single garage door on the west side.  
The property has Geo Thermo heating and cooling system, in floor heating system/radiant heat in basement, 24 zone irrigation system, Kenitico water system, newer well tank in basement, hot water to 3 car garage up.  Take a stroll on the walking paths next to home that takes you back to the Mississippi river, for this home is a &quot;MUST SEE&quot;
